.related-section {
    width: 100%;
    padding: 80px 160px;
    background: #FFFFFF;
}

.related-container {
    max-width: 1440px;
    margin: 0 auto;
    display: flex;
    flex-direction: column;
    gap: 32px;
}

.related-title {
    font-family: 'ABeeZee', sans-serif;
    font-weight: 400;
    font-style: italic;
    font-size: 24px;
    line-height: 32px;
    letter-spacing: 0;
    margin: 0;
}

.related-grid {
    display: grid;
    grid-template-columns: repeat(4, 1fr);
    gap: 16px;
}

/* Адаптивность */
@media (max-width: 768px) {
    .related-section {
        padding: 40px 20px;
    }
    
    .related-grid {
        grid-template-columns: repeat(1, 1fr);
    }
}

@media (max-width: 1024px) {
    .related-grid {
        grid-template-columns: repeat(2, 1fr);
    }
}

@media (max-width: 1200px) {
    .related-section {
        padding: 60px 80px;
    }
    
    .related-grid {
        grid-template-columns: repeat(3, 1fr);
    }
}

